class Solution {

    /**
     * @param Integer $start
     * @param Integer $finish
     * @param Integer $limit
     * @param String $s
     * @return Integer
     */
    function numberOfPowerfulInt($start, $finish, $limit, $s) {
        $count = 0;
        $sLen = strlen($s);
        $minVal = (int)$s;
        $maxPrefix = intval(str_repeat($limit, strlen($finish) - $sLen));

        for ($prefix = 0; $prefix <= $maxPrefix; $prefix++) {
            $val = intval($prefix . $s);
            if ($val >= $start && $val <= $finish) {
                $isValid = true;
                while ($val > 0) {
                    if ($val % 10 > $limit) {
                        $isValid = false;
                        break;
                    }
                    $val = intval($val / 10);
                }
                if ($isValid) {
                    $count++;
                }
            }
        }

        return $count;
    }
}
